import React from "react";
import { useHistory } from "react-router-dom";

function Button() {
  const history = useHistory();
  const routeChange = () => {
    let path = "/game";
    history.push(path);
    return (
      <div>
        <Button color="primary" className="px-4" onClick={routeChange}>
          Play Game
        </Button>
      </div>
    );
  };
}
export default Button;
